function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://www.instagram.com/p/CJCrsdPj4i-/?__a=1&max_id=endcursor")
    .then(response => response.json())
    .then(data => setData(data.graphql.shortcode_media.edge_media_to_caption.edges));
  }, [])

  return (
    <div className="App">
      {console.log(data)}
      { data.map((item) => {
        console.log(item.text)
      })}
    </div>
  );
}

export default App;
